import React from 'react';
import { useEffect, useState } from 'react';
import './App.css';

import airforce from './airforce.png';

URL = "http://localhost:3001/drone/test"

const App = () => {

  const [data, setData] = useState(null)

  useEffect( () => {
    testAPI()
  }, [] );

  const testAPI = async() => {
    const response = await fetch(URL);
    const retrieve = await response.text();

    setData(retrieve);
  };

  return (

    <div className='App'>

      <div className='LogoContainer'>
        <div className='textContainer'>
            <h1>Angels of Heaven</h1>
            <h2>Unmanned Aerial Vehicle Information Interface</h2>
        </div>

        <img className='logo' src={airforce} />
      </div>

      <div className='test'>

        <h1>
          {data}
        </h1>

      </div>


    </div>

  );

}

export default App;
